--  DDL for Trigger PROGRAMAR_MANTENIMIENTO
--------------------------------------------------------

  CREATE OR REPLACE NONEDITIONABLE TRIGGER "JAVALENCIA"."PROGRAMAR_MANTENIMIENTO" for update on vehiculos compound trigger
    valor number;
    after each row is
    begin
        valor := :new.id;
    end after each row;
    after statement is
    begin
        Programar_mantenimiento(valor);
        dbms_output.put_line('El id actualizado es ' || valor);
    end after statement;
end;
