--------------------------------------------------------
--  DDL for Function CALCULAR_CAJAS_NECESARIAS
--------------------------------------------------------

  CREATE OR REPLACE NONEDITIONABLE FUNCTION "JAVALENCIA"."CALCULAR_CAJAS_NECESARIAS" (items in number, cajas_grandes in number, cajas_pequenas in number)
return number is
--items number := &items;
--cajas_grandes number := &cajas_grandes;
--cajas_pequenas number := &cajas_pequeñas;
result number :=0;
numero number := 0;
numero2 number := 0;
contador_cg number := 0;
contador_cp number := 0;
numarticulos number :=0;
salida number;
salida2 number;
limite_grandes number := 5;
limite_pequenas number := 1;
begin
for i in 1..cajas_grandes loop
    numero := limite_grandes*i;
    if numero < items then
        contador_cg := contador_cg + 1;
        numarticulos := numero;
        else
        salida :=1;
        numero := 0;
    end if;
    exit when salida = 1;
end loop;    
    for j in 1..cajas_pequenas loop
        numero2 := numarticulos;
        if numero2 < items then
            contador_cp := contador_cp + 1;
            numarticulos := numarticulos + 1;
            else
            salida2 :=1;
        end if;
        exit when salida2 = 1;
    end loop;
    if numarticulos < items then
        result := -1;
        dbms_output.put_line('Retorna -1');
        else
        result := contador_cg + contador_cp;
        dbms_output.put_line('retorna ' || result);
    end if; 
return result;
end;

